        "category": "core",
        "title": "Buttons",
        "html": "<h2 id=\"buttonstyles\">Button Styles</h2>\n<p></br></br>\nWe have five button styles. Primary, secondary, toggle, flat and icon buttons.</p>\n<pre><code class=\"markup language-markup\">&lt;button&gt;Primary Button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button&gt;Primary button&lt;/button&gt; \n</code></pre>\n<p></br></br>\nA <strong>secondary button</strong> isn't as import as a primary one, so it shouldn't call as much attention. This button could be used for actions such as Cancel, Abort, Reset or Go back. </p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"mod-secondary\"&gt;Secondary Button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"mod-secondary\"&gt;Secondary Button&lt;/button&gt;\n</code></pre>\n<p></br></br>\n<strong>Toggle buttons</strong> allow single choice to be selected or deselected</p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"mod-secondary mod-toggle\"&gt;Toggle Button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"mod-secondary mod-toggle\"&gt;Toggle Button&lt;/button&gt;\n</code></pre>\n<p></br></br>\n<strong>Flat buttons</strong> looks like a normal anchor but on click they become the look of an button for a short time.</p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"mod-flat\"&gt;Flat button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"mod-flat\"&gt;Flat button&lt;/button&gt;\n</code></pre>\n<p></br></br>\nA button could also just contain an <strong>icon</strong></p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"mod-secondary\"&gt;&lt;span class=\"icon-pencil\"&gt;&lt;/span&gt;&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"mod-secondary\"&gt;&lt;span class=\"icon-pencil\"&gt;&lt;/span&gt;&lt;/button&gt;\n</code></pre>\n<p></br></br></p>\n<h2 id=\"buttonstates\">Button states</h2>\n<p></br></br>\nButtons can have different states which can be represented using classes.\n</br></br>\n<strong>Disabled</strong></p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"is-disabled\"&gt;Disabled button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"is-disabled\"&gt;Disabled button&lt;/button&gt;\n</code></pre>\n<p></br></br>\n<strong>Focused</strong></p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"is-focused\"&gt;Focused button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"is-focused\"&gt;Focused button&lt;/button&gt;\n</code></pre>\n<p></br></br>\n<strong>Toggled</strong></p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"is-toggled\"&gt;Toggled button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"is-toggled\"&gt;Toggled button&lt;/button&gt;\n</code></pre>\n<p></br></br></p>\n<h2 id=\"buttonsizes\">Button sizes</h2>\n<p></br></br>\nAll of our buttons can be small, normal or large. For normal buttons just do nothing and for small or large buttons add a modifier class.</p>\n<pre><code class=\"markup language-markup\">&lt;button class=\"mod-large\"&gt;Large button&lt;/button&gt;\n&lt;button&gt;Normal button&lt;/button&gt;\n&lt;button class=\"mod-small\"&gt;Small button&lt;/button&gt;\n</code></pre>\n<pre><code class=\"html language-html\">&lt;button class=\"mod-large\"&gt;Large button&lt;/button&gt;\n&lt;button&gt;Normal button&lt;/button&gt;\n&lt;button class=\"mod-small\"&gt;Small button&lt;/button&gt;\n</code></pre>\n<p></br></br></br></br></br></p>",
